  render() {
    return (
      <Html lang="en">
        <Head />
        <meta name="viewport" content="initial-scale=1, maximum-scale=1" />
        <link
          href="https://fonts.googleapis.com/css2?family=Lora:ital@1&display=swap"
          rel="stylesheet"
        />
        <body style={{ fontFamily: `'Lora', sans-serif` }}>
          <Main />
          <NextScript />
        </body>
      </Html>
    );
  }
}
